import React, { useState } from "react";
import { Helmet } from "react-helmet";
import { Menu, MenuItem, Sidebar } from "react-pro-sidebar";
import { Heading, Text, Img } from "../../components";

export default function Home1Page() {
  const [collapsed, setCollapsed] = useState(false);

  const toggleSidebar = () => {
    setCollapsed(!collapsed);
  };

  return (
    <>
      <Helmet>
        <title>Attendance & tracking monitoring system</title>
        <meta name="description" content="Web site created using create-react-app" />
      </Helmet>
      <div className="flex md:flex-col items-start w-full gap-4 bg-white-A700_01">
        <Sidebar
          width="288px !important"
          collapsedWidth="80px !important"
          collapsed={collapsed}
          onClick={toggleSidebar}
          className="flex flex-col h-screen pb-[65px] top-0 md:pb-5 border-black-900 border border-solid bg-indigo-800_01 shadow-xl !sticky overflow-auto"
        >
          <div className="flex flex-col self-stretch items-start">
            <Heading size="lg" as="h2" className="ml-[11px] !text-white-A700_01 !font-segoeui">
              Smart Access Control System
            </Heading>
            <Menu
              menuItemStyles={{
                button: {
                  padding: "7px",
                  gap: "15px",
                  alignSelf: "start",
                  color: "#ffffff",
                  fontWeight: 600,
                  fontSize: "24px",
                },
              }}
              rootStyles={{ "&>ul": { gap: "75.50px" } }}
              className="flex flex-col self-center items-center w-full mt-[100px]"
            >
              <MenuItem icon={<Img src="images/img_darhboard.svg" alt="dashboard_icon" className="h-[24px] w-[24px]" />}>
                <a href="../Page3monitroing">Monitoring AP</a>
              </MenuItem>
              <MenuItem icon={<Img src="images/img_group_light.svg" alt="group_icon" className="h-[33px]" />}>
                <a href="../user1">User management</a>
              </MenuItem>
              <MenuItem icon={<Img src="images/img_desk_alt.svg" alt="desk_icon" className="h-[24px] w-[24px]" />}>
                <a href="#">New Reservation</a>
              </MenuItem>
            </Menu>
          </div>
        </Sidebar>
        <div className="flex flex-col gap-3.5 flex-1">
          <Heading size="md" as="h1" className="ml-5 mt-5 !font-black">
            New Reservations
          </Heading>
          <div className="flex md:flex-col gap-[78px] p-2.5 bg-gray-100_04">
            {/* Reservation items */}
          </div>
          <div className="flex ml-2.5 pt-3.5 px-3.5 bg-gray-100_02">
            {/* Other content */}
          </div>
        </div>
      </div>
    </>
  );
}
